import React, { Component, Fragment } from 'react'
import axios from 'axios'
import Data from "./Data.json";
import "./profile1.css";

export default class Task extends Component {
    constructor(props) {
        super(props)

        this.state = {
            profile : []
        }
    }

    componentDidMount() {
        axios.get("./Data.json").then(
            (res) => {
                console.log(res.data);
                this.setState({
                    profile1: res.data
                })
            }
        ).catch(() => {
            console.log("Data Not Found");
        })
    }
    render() {
        let {profile1} = this.state;
        return (
            <Fragment>
                {
                    Data.players.length?Data.players.map((profile) => {
                        return <div key={profile.img}>{}{profile.name} {profile.country}</div>
                }):null
                }
            </Fragment>
        )
    }
}
